import React from "react";
import BlogCard from "./BlogCard";
import PortionEnd from "../PortionEnd";
import PortionTop from "../PortionTop";

export default function BlogContainer() {
  return (
    <>
      <div className="cards-container">
        <PortionTop title={"Latest Articles"} btn_title={"browse all articles"} />
        <div className="post-grid">
          <BlogCard />
          <BlogCard />
          <BlogCard />
          <BlogCard />
          <BlogCard />
          <BlogCard />
          <BlogCard />
          <BlogCard />
        </div>
        <PortionEnd title="Load More Articles"/>
      </div>
    </>
  );
}
